#         return sorted([abs(nums[i]-nums[j]) for i in range(len(nums)) for j in range(i+1, len(nums))])[k-1]

import bisect
class Solution:
    def smallestDistancePair(self, nums: [int], k: int) -> int:
        def count_pairs(low, high, mid):
            ans = 0
            for i in range(low, high+1):
                ans += bisect.bisect_right(nums, nums[i]+mid, low, high) - (i+1)
            return ans
        nums.sort()
        low = nums[1] - nums[0]
        for i in range(1, len(nums)-1):
            low = min(low, nums[i+1]-nums[i])
        high = nums[len(nums)-1] - nums[0]
        while low < high:
            mid = (low+high)>>1
            if count_pairs(low, high, mid)<k:
                low = mid + 1
            else:
                high = mid
        return low


